Since 2003, AbbVie Inc. has raised the price of its best-selling drug Humira 27 times &amp; it currently costs $77,586/year! 

@OversightDems' Chair @RepMaloney will hold a hearing w/AbbVie CEO Richard Gonzalez to examine the company's business practices. 

WATCH on 5/18 @ 10 AM.

